<html>
<head>
	<title>Tic Tac Toe</title>
	<link href='http://fonts.googleapis.com/css?family=Lobster' rel='stylesheet' type='text/css'>
	<link href="style.css" rel="stylesheet" type="text/css" />
</head>
<body>
	<div id="container">
		<h1 id="tictactoe" class="header" >Tic! Tac!! Toe!!!</h1>
		<table>
			<tbody>
				<tr class="row">
					<td class="cell" id="cellOne">1</td>
					<td class="cell" id="cellTwo">2</td>
					<td class="cell" id="cellThree">3</td>
				</tr>
				<tr class="row">
					<td class="cell" id="cellFour">4</td>
					<td class="cell" id="cellFive">5</td>
					<td class="cell" id="cellSix">6</td>
				</tr>
				<tr class="row">
					<td class="cell" id="cellSeven">7</td>
					<td class="cell" id="cellEight">8</td>
					<td class="cell" id="cellNine">9</td>
				</tr>
			</tbody>
		</table>
	</div>
</body>
<footer>
	
</footer>
</html>
